Once I took my focus back to my Goals and my Vision it was crazy everything became much easier and simpler too. I became happier, much happier. My Purpose and Meaning in life also stormed back in droves.

It was my epiphany moment!! 

How did I do this? Good question. Like most things in life I keep it simple, the simpler it is the the bigger I find the changes to be. So every morning I check in with myself while I am showering (I have this pinned to my shower wall) and ask myself two questions.

